import React from 'react'

class MainContent extends React.Component {
  constructor() {
    super()
  }

  render() {
    return (
      <div id="body">
        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla dolor massa, commodo et auctor sed, semper consequat odio. Proin maximus, ante at rhoncus finibus, quam lectus lobortis diam, in elementum metus mi id leo. Vivamus eu turpis lectus. Phasellus lobortis, arcu at facilisis dapibus, justo nibh luctus metus, a mollis velit tortor ac odio. Donec ultricies dapibus dui, in aliquet ligula euismod eget. Pellentesque nec urna malesuada, pretium turpis rutrum, ultricies diam. Sed sed augue purus. Cras condimentum, lectus id tempus pharetra, libero ante consequat velit, vestibulum scelerisque orci libero vel felis. Etiam sit amet dui consectetur, tristique dui quis, ornare eros. Morbi tempus, enim non fringilla facilisis, nisi sapien malesuada arcu, in rutrum quam risus vitae mi. Donec nec imperdiet ligula. Curabitur varius urna dignissim mauris mattis, sit amet suscipit nunc euismod. Duis consectetur erat non lacinia facilisis.</p>

      </div>
    )
  }
}

export default MainContent
